export default  function Main() {
    function handleEditAvatarClick() {
        const editAvatarPopup = document.querySelector('popup_type_avatar"')
        editAvatarPopup.classList.add('popup_opened')
    }
    function handleEditProfileClick() {
        const editAvatarPopup = document.querySelector('popup_type_avatar"')
        editAvatarPopup.classList.add('popup_opened')
    }
    function handleAddPlaceClick() {
        const editAvatarPopup = document.querySelector('popup_type_avatar"')
        editAvatarPopup.classList.add('popup_opened')
    }
    return(
        <main className="content">
            <section className="profile">
                <div className="profile__description">
                    <div className="profile__avatar">
                        <img
                            className="profile__picture"
                            src="#"
                            alt="Фотография Жака-Ив Кусто"
                        />
                        <button className="button botton_type_avatar" type="button" onClick={handleEditAvatarClick}></button>
                    </div>
                    <div className="profile__text">
                        <div className="profile__wrapper">
                            <h1 className="profile__title">#</h1>
                            <button className="button button_type_edit" type="button" onClick={handleEditProfileClick}></button>
                        </div>
                        <p className="profile__subtitle">#</p>
                    </div>
                </div>
                <button className="button button_type_add" type="button" onClick={handleAddPlaceClick}></button>
            </section>
            <section className="photo-grid">
                <ul className="photo-grid__list"></ul>
            </section>
        </main>
    )
}
